import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid'

import "../App.css"

const TodoSubList = props => {

    let container =
        <Grid container direction='column' spacing='2'>
            {props.map(input =>

                <Grid item>
                    <Grid container spacing={3}>
                        <Grid item>
                            {input.miniT}
                        </Grid>
                        <Grid item>
                            {input.completed}
                        </Grid>
                        <Grid item>
                            Tester
                    </Grid>

                    </Grid>
                </Grid>
            )}

        </Grid>


    return container
}



export default TodoSubList;
